        }

        public ItemsDTO<Order> GetOrdersGridRows(Action<IGridColumnCollection<Order>> columns, QueryDictionary<StringValues> query)
        {
            var server = new GridCoreServer<Order>(Orders, query, true, "ordersGrid", columns)
                        .WithPaging(10)
                        .Sortable()
                        .Filterable()
                        .WithMultipleFilters()
                        .Groupable(true)
                        .Searchable(true, false, false)
                        .SetRemoveDiacritics<StringUtils>("RemoveDiacritics");

            var items = server.ItemsToDisplay;
            return items;
        }

