        public async Task Add1ToFreight(int OrderId)
        {
            var order = await Get(OrderId);
            if (order.Freight.HasValue)
            {
                order.Freight += 1;
                await Update(order);
            }
        }

        public async Task Subtract1ToFreight(int OrderId)
        {
            var order = await Get(OrderId);
            if (order.Freight.HasValue)
            {
                order.Freight -= 1;
                await Update(order);
            }
        }

        public async Task<Order> Get(params object[] keys)
        {
            int orderId;
            int.TryParse(keys[0].ToString(), out orderId);
            var order = Orders.SingleOrDefault(r => r.OrderID == orderId);
            return await Task.FromResult(order);
        }

        public async Task Insert(Order item)
        {
            if(item.OrderID == 0)
                item.OrderID = Orders.Max(r => r.OrderID) + 1;

            var order = Orders.SingleOrDefault(r => r.OrderID == item.OrderID);
            if (order == null)
            {
                if(!string.IsNullOrWhiteSpace(item.CustomerID))
                    item.Customer = CustomerService.Customers.SingleOrDefault(r => r.CustomerID == item.CustomerID);
                if(item.ShipVia.HasValue)
                    item.Shipper = ShipperService.Shippers.SingleOrDefault(r => r.ShipperID == item.ShipVia.Value);
                if (item.EmployeeID.HasValue)
                    item.Employee = EmployeeService.Employees.SingleOrDefault(r => r.EmployeeID == item.EmployeeID.Value);
                item.OrderDetails = OrderDetailService.OrderDetails.Where(r => r.OrderID == item.OrderID).ToList();

                Orders.Add(item);
                await Task.CompletedTask;
            }
            else
            {
                throw new GridException("ORDSRV-01", "Error creating the order");
            }
        }

        public async Task Update(Order item)
        {
            var order = Orders.SingleOrDefault(r => r.OrderID == item.OrderID);
            if (order != null)
            {
                if (!string.IsNullOrWhiteSpace(item.CustomerID))
                    item.Customer = CustomerService.Customers.SingleOrDefault(r => r.CustomerID == item.CustomerID);
                if (item.ShipVia.HasValue)
                    item.Shipper = ShipperService.Shippers.SingleOrDefault(r => r.ShipperID == item.ShipVia.Value);
                if (item.EmployeeID.HasValue)
                    item.Employee = EmployeeService.Employees.SingleOrDefault(r => r.EmployeeID == item.EmployeeID.Value);
                item.OrderDetails = OrderDetailService.OrderDetails.Where(r => r.OrderID == item.OrderID).ToList();

                order = item;
                await Task.CompletedTask;
            }
            else
            {
                throw new GridException("ORDSRV-02", "Error updating the order");
            }
        }

        public async Task Delete(params object[] keys)
        {
            var order = await Get(keys);
            if (order != null)
            {
                Orders.Remove(order);
            }
            else
            {
                throw new GridException("ORDSRV-03", "Error deleting the order");
            }
        }

        public async Task<decimal?> GetMaxFreight(string clientName, QueryDictionary<StringValues> query)
        {
            var server = new GridCoreServer<Order>(Orders.Where(o => o.Customer.CompanyName == clientName), query, true, "ordersGrid", null)
                .AutoGenerateColumns()
                .Sortable()
                .Filterable()
                .WithMultipleFilters()
                .SetRemoveDiacritics<StringUtils>("RemoveDiacritics");
            return await Task.FromResult(server.ItemsToDisplay.Items.Max(r => r.Freight));
        }

        public async Task<decimal?> GetMinFreight(string clientName, QueryDictionary<StringValues> query)
        {
            var server = new GridCoreServer<Order>(Orders.Where(o => o.Customer.CompanyName == clientName), query, true, "ordersGrid", null)
                .AutoGenerateColumns()
                .Sortable()
                .Filterable()
                .WithMultipleFilters()
                .SetRemoveDiacritics<StringUtils>("RemoveDiacritics");
            return await Task.FromResult(server.ItemsToDisplay.Items.Min(r => r.Freight));
        }

